module.exports.start = function($happn, callback) {

  var terminal;

  if (terminal = $happn.exchange.terminal) {

    terminal.register('demo', {

      run: function(args, callback) {
        console.log('\n\npending\n\n');
        callback();
      }

    })

  }
    
  callback(null);
}

module.exports.stop = function(callback) {

  callback(null);

}
